package corejava;
// Java Program For PatternStar

class PatternStar {
// Main Method
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		// Creating Variable
		int n= 10;
		for(int i=0;i<=4;i++) {
			for(int j =0;j<=n;j++) {
				
				// Output For Program
				System.out.print("* ");
			}
			// Printing The Output in New Line
			System.out.println();
			
		}
	}
}


